el3629.text = "\n        document.addEventListener(\"DOMContentLoaded\", function () {\n            const currentYear = new Date().getFullYear();\n\n            const yearOptions = Array.from(\n                { length: currentYear - 2010 + 1 },\n                (_, i) =\u003e 2010 + i\n            );\n\n            Array.from(document.getElementsByClassName(\"year_selectors\")).forEach(\n                function (item) {\n                    yearOptions.forEach((year) =\u003e {\n                        const option = document.createElement(\"option\");\n                        option.value = year;\n                        option.textContent = year;\n                        item.appendChild(option);\n                    });\n                    item.value = null;\n                }\n            );\n        });\n\n\n        document.addEventListener(\"DOMContentLoaded\", function () {\n            fetch(\'./vineyard/json/grape_var_JSON.json\')\n                .then(response =\u003e response.json())\n                .then(data =\u003e {\n                    jsonObject = data;\n                    // You can use jsonData here.\n                    const inputElement = document.getElementById(\"grapeVar_Input\");\n                    const dataListElement = document.getElementById(\"grapeVar_Options\");\n\n                    for (const key in jsonObject) {\n                        const option = document.createElement(\"option\");\n                        option.value = key;\n                        dataListElement.appendChild(option);\n                    }\n                })\n                .catch((error) =\u003e {\n                    console.error(\'Error:\', error);\n                });\n        });\n\n\n\n        function rescale_end_year() {\n            const currentYear = new Date().getFullYear();\n            const end_val = document.getElementById(\"yearSelect_last\").value;\n            const end_list = document.getElementById(\"yearSelect_last\");\n            end_list.innerHTML = \"\";\n            const beg_val = document.getElementById(\"yearSelect_first\").value;\n\n            const yearOptions = Array.from(\n                { length: currentYear - parseInt(beg_val) + 1 },\n                (_, i) =\u003e parseInt(beg_val) + i\n            );\n\n            yearOptions.forEach((year) =\u003e {\n                const option = document.createElement(\"option\");\n                option.value = year;\n                option.textContent = year;\n                end_list.appendChild(option);\n            });\n            if (beg_val \u003c end_val) {\n                document.getElementById(\"yearSelect_last\").value = end_val;\n            }\n\n            // Update the end year value and selected options on first year change\n            if (!document.getElementById(\"yearSelect_last\").hasAttribute(\'value\')) {\n                document.getElementById(\"yearSelect_last\").setAttribute(\'value\', document.getElementById(\"yearSelect_last\").value);\n            } else {\n                document.getElementById(\"yearSelect_last\").setAttribute(\'value\', document.getElementById(\"yearSelect_last\").value);\n            }\n\n            // For a multiple select, you need to iterate over the options\n            for (let option of document.getElementById(\"yearSelect_last\").options) {\n            if (option.selected) {\n                option.setAttribute(\'selected\', true);\n            } else {\n                option.removeAttribute(\'selected\');\n            }\n            }\n            \n        }\n\n        function numYears_form_dup() {\n            const beg_val = document.getElementById(\"yearSelect_first\").value;\n            const end_val = document.getElementById(\"yearSelect_last\").value;\n        }\n\n        var jsonColorObj = null;\n        var jsonObj = null;\n\n        // get contrasting text color for a given hex color, for the soli color radio labels text\n        function getContrastingTextColor(hexColor) {\n    // Remove the hash at the beginning of the hex color, if it\'s there\n    hexColor = hexColor.replace(/^#/, \'\');\n    \n    // Convert the hex color to RGB\n    const r_color = parseInt(hexColor.substr(0, 2), 16);\n    const g_color = parseInt(hexColor.substr(2, 2), 16);\n    const b_color = parseInt(hexColor.substr(4, 2), 16);\n    \n    // Calculate the luminance of the color\n    const luminance = (0.299 * r_color + 0.587 * g_color + 0.114 * b_color) / 255;\n    \n    // Return black for light colors, white for dark colors\n    return luminance \u003e 0.5 ? \'#000000\' : \'#FFFFFF\';\n}\n\n\n\n        function useJsonColorObj() {\n\n/* --------------------------------- soilColorText  horizO input --------------------------------- */\nfor (let step = 0; step \u003c 4; step++) {\n    // const inputElement = document.getElementById(\"soilColorText__horiz\" + step + \"_Input\");\n    const dataListElement = document.getElementById(\"soilColorText__horiz\" + step + \"_Options\");\n    document\n        .getElementById(\"soilColorText__horiz\" + step + \"_Input\")\n        .addEventListener(\"change\", function () {\n            const targetDiv = document.getElementById(\n                \"colorChoices__horiz\" + step + \"_container\"\n            );\n  \n            targetDiv.innerHTML = \"\";\n            const change_jsonColorObj =\n                jsonColorObj[\n                document.getElementById(\"soilColorText__horiz\" + step + \"_Input\").value\n                ];\n           // console.log(change_jsonColorObj);\n            for (const el in change_jsonColorObj) {\n                master = String(change_jsonColorObj[el]).split(\" \");\n\n                hue = master[0];\n\n                minster = master[1].split(\"-\");\n                val = minster[0];\n                chroma = minster[1];\n\n\n                for (const key in jsonObj) {\n                    if (\n                        jsonObj[key].h == hue \u0026\u0026\n                        jsonObj[key].V == val \u0026\u0026\n                        jsonObj[key].C == chroma\n                    ) {\n                        const radio_ID = \`\${jsonObj[key].h}__\${jsonObj[key].V}_\${jsonObj[key].C}\`;\n                        const radio_text = \`\${jsonObj[key].h} \${jsonObj[key].V}/\${jsonObj[key].C}\`;\n                        const hex_color = jsonObj[key].hex;\n                        const textColor = getContrastingTextColor(hex_color, true);\n                        // alert(textColor)\n\n\n\nconst newDiv = \`\u003cdiv id=\"\${radio_ID}_pannel\" class=\"horizon\${step}_selectors\" style=\"background-color:\${hex_color};margin-top: 0;padding-left: 20px;\"\u003e\u003cinput type=\"radio\" name=\"horizon\${step}_color\" id=\"\${radio_ID}\" value=\"\${radio_ID}\" class=\"toggle toggle-left\" style=\"vertical-align: text-top;\"\u003e\u003clabel for=\"\${radio_ID}\" class=\"btn\" style=\"color:\${textColor}\"\u003e\${radio_text}\u003c/label\u003e\u003c/div\u003e\`;\n\n                        // const newDiv = \`\u003cdiv id=\"\${radio_ID}_pannel\" class=\"horizon\${step}_selectors\" style=\"background-color:\${hex_color}\"\u003e\u003cinput type=\"radio\" name=\"horizon\${step}_color\" id=\"\${radio_ID}\" value=\"\${radio_ID}\" class=\"toggle toggle-left\"\u003e\u003clabel for=\"\${radio_ID}\" class=\"btn\"\u003e\${radio_text}\u003c/label\u003e\u003c/div\u003e\`;\n\n                        targetDiv.innerHTML += newDiv;\n                    }\n                }\n\n            }\n           // console.log(targetDiv)\n        });\n\n\n}\n\n}\n        /* --------------------------------- /soilColorToHEX --------------------------------- */\n\n        //  document.addEventListener(\"DOMContentLoaded\", function () {\n        function soilColors() {\n           // console.log(\'#1\')\n            Promise.all([\n                fetch(\'./vineyard/json/Munsell_soil_colors_JSON.json\')\n                    .then(response =\u003e response.json())\n                    .then(data =\u003e {\n                        jsonColorObj = data;\n                        // return jsonColorObj;\n                    }),\n                fetch(\'./vineyard/json/Munsell_2_rgb_JSON.json\')\n                    .then(response =\u003e response.json())\n                    .then(data =\u003e {\n                        jsonObj = data;\n                        // return jsonObj;\n                    })\n            ])\n                .then(() =\u003e {\n                    \n                   // console.log(\'check if the json object is here\')\n                   // console.log(jsonObj)\n                    \n                    for (let step = 0; step \u003c 4; step++) {\n                        const dataListElement = document.getElementById(\"soilColorText__horiz\" + step + \"_Options\");\n                        for (const key in jsonColorObj) {\n                            const option = document.createElement(\"option\");\n                            option.value = key;\n                            dataListElement.appendChild(option);\n                        }\n                    }\n                    useJsonColorObj();  // Call the function that uses jsonColorObj.\n                })\n                .catch((error) =\u003e {\n                    console.error(\'Error:\', error);\n                });\n        // });\n        }\n\n        soilColors();\n\n    ";
